import axios from 'axios'
import React, { useEffect, useState } from 'react'
import url from './host'
import { Input, message } from 'antd'

export default function Users() {

var [data, setData]=useState([])
  function getData() {
  axios.get(`${url}/api/v1/category`).then(res=>{
    setData(res.data)
  }).catch(err=>{
    message.error("don`t get category")
  })
}
 useEffect(()=>{
  getData()
 })



  return (
    <div>


<div className="category_cards">
  <div className="category_card">
    <img src="" alt="" />
    <h1 className="title"></h1>
    <p className='id'></p>
  </div>
</div>


<Modal title="Create Company" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}>
      <Form
    {...formItemLayout}
    variant="filled"
    style={{
      maxWidth: 600,
    }}
  >
    <Form.Item
      label="Address"
      name="InputAddress"
      rules={[
        {
          required: true,
          message: 'Iltimos manzilni kiriting!',
        },
      ]}
    >
      <Input className='InputAddress' />
    </Form.Item>

    <Form.Item
      label="Email"
      name="InputEmail"
      rules={[
        {
          required: true,
          message: 'Iltimos emailni kiriting!',
        },
      ]}
    >
      <Input className='InputEmail' />
    </Form.Item>
    <Form.Item
      label="Facebook"
      name="InputFacebook"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input className='InputFacebook' />
    </Form.Item>
    <Form.Item
      label="Telegram"
      name="InputTelegram"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input className='InputTelegram' />
    </Form.Item>
    <Form.Item
      label="Youtobe"
      name="InputYoutube"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input className='InputYoutube' />
    </Form.Item>
    <Form.Item
      label="Instagram"
      name="InputInstagram"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input className='InputInstagram' />
    </Form.Item>
    <Form.Item
      label="Languation"
      name="InputLanguation"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input className='InputLanguation' />
    </Form.Item>
    <Form.Item
      label="Location"
      name="InputLocation"
      rules={[
        {
          required: true,
          message: 'Iltimos linkni kititing!',
        },
      ]}
    >
      <Input className='InputLocation' />
    </Form.Item>
    <Form.Item
      label="Phone"
      name="InputNumber"
      rules={[
        {
          required: true,
          message: 'Iltimos raqamni kititing!',
        },
      ]}
    >
      <Input
        style={{
          width: '100%',
        }}
         type='number'
        className='InputNumber'
      />
    </Form.Item>
    <Form.Item label="Upload" valuePropName="fileList">
    <div className='file_input' listType="picture-card"> 
    <input type="file" className='get_datainput' id="modal_data_file" />
            <button
              style={{
                border: 0,
                background: 'none',
              }}
              type="button"
            >
              <PlusOutlined />
              <div
                style={{
                  marginTop: 8,
                }}
              >
                Upload
              </div>
            </button>
          </div>
        </Form.Item>
  </Form>
      </Modal>




    </div>
  )
}
